export type EasingImplementation =
  ((t: number, b: number, c: number, d: number) => number) |
  ((t: number, b: number, c: number, d: number, s?: number) => number);

/* istanbul ignore next */
export const Linear = {
  none: (t: number, b: number, c: number, d: number): number => {
    return c * t / d + b;
  }
};

/* istanbul ignore next */
export const Quad = {
  in: (t: number, b: number, c: number, d: number): number => {
    return c * (t /= d) * t + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return -c * (t /= d) * (t - 2) + b;
  }
};

/* istanbul ignore next */
export const Cubic = {
  in: (t: number, b: number, c: number, d: number): number => {
    return c * (t /= d) * t * t + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return c * ((t = t / d - 1) * t * t + 1) + b;
  }
};

/* istanbul ignore next */
export const Quart = {
  in: (t: number, b: number, c: number, d: number): number => {
    return c * (t /= d) * t * t * t + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return -c * ((t = t / d - 1) * t * t * t - 1) + b;
  }
};

/* istanbul ignore next */
export const Quint = {
  in: (t: number, b: number, c: number, d: number): number => {
    return c * (t /= d) * t * t * t * t + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return c * ((t = t / d - 1) * t * t * t * t + 1) + b;
  }
};

/* istanbul ignore next */
export const Sine = {
  in: (t: number, b: number, c: number, d: number): number => {
    return -c * Math.cos(t / d * (Math.PI / 2)) + c + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return c * Math.sin(t / d * (Math.PI / 2)) + b;
  }
};

/* istanbul ignore next */
export const Expo = {
  in: (t: number, b: number, c: number, d: number): number => {
    return (t === 0) ? b : c * Math.pow(2, 10 * (t / d - 1)) + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return (t === d) ? b + c : c * (-Math.pow(2, -10 * t / d) + 1) + b;
  }
};

/* istanbul ignore next */
export const Circ = {
  in: (t: number, b: number, c: number, d: number): number => {
    return -c * (Math.sqrt(1 - (t /= d) * t) - 1) + b;
  },
  out: (t: number, b: number, c: number, d: number): number => {
    return c * Math.sqrt(1 - (t = t / d - 1) * t) + b;
  }
};

/* istanbul ignore next */
export const Back = {
  in: (
    t: number,
    b: number,
    c: number,
    d: number,
    s: number = 1.70158
  ): number => {
    return c * (t /= d) * t * ((s + 1) * t - s) + b;
  },
  out: (
    t: number,
    b: number,
    c: number,
    d: number,
    s: number = 1.70158
  ): number => {
    return c * ((t = t / d - 1) * t * ((s + 1) * t + s) + 1) + b;
  }
};

